 	margin-bottom: 2px;}


/*CodeSnippet for animated underline yoink'd from 30secondsofcode.org*/
.TopLinks a { 
 	display: inline-block;
	position: relative;}

.TopLinks a::before {
	color: #999;
	content: "▼";
	position: absolute;
	width: 100%;
  	transform: scaleX(0);
  	height: 1px;
  	top: -10px;
  	left: 0;
}

